const image = [
  "data:image/png;base64,",
  "data:image/png;base64,",
];
let tx, sx;
let count = 0;
let second = null;
let fps = 0;

function setup() {
  tx = 330;
  ajiSetBG(0, image[0]);
}

function loop() {
  ajiDrawBG(0, 0, 0);
  ajiDrawSprite("sprite", sx, 30);
  ajiSetFont("20pt sans-serif");
  ajiSetFillColor("#fff");
  ajiDrawText("Hello, world!", tx, 125);
  ajiDrawText("Mouse: " + ajiMouseX() + ", " + ajiMouseY(), 10, 200);
  ajiDrawText("FPS: " + fps, 10, 230);
  tx -= 3;
  if (sx >= 195) {
    ajiDeleteSprite("sprite");
  } else {
    sx++;
  }
  if (count == 0 && ajiExistSprite("sprite") == false) {
    ajiAddSprite("sprite", image[1]);
    sx = -30;
  }
  count++;
  const date = new Date();
  if (second != date.getSeconds()) {
    fps = count;
    count = 0;
    second = date.getSeconds();
  }
  if (tx < -300) {
    tx = 330;
  }
}
